Methods are functions that are associated with a specific type and either refer to that type or mutate it. Associated functions are very similar, but they do not use any of the data in the type. Associated functions could be standalone functions, but they are included in a specific type for organizational or semantic reasons. To declare methods and associated functions for a struct or enum, use an impl block . Here, impl stands for implementation. script; struct Foo { bar: u64, baz: bool,
} impl Foo { // this is a _method_, as it takes `self` as a parameter. fn is_baz_true(self) -> bool { self.baz } // this is an _associated function_, since it does not take `self` as a parameter. fn new_foo(number: u64, boolean: bool) -> Foo { Foo { bar: number, baz: boolean, } }
} fn main() { let foo = ~Foo::new_foo(42, true); assert(foo.is_baz_true());
} Note the syntax of the associated function call: ~Foo::new_foo(42, true);. This bit of syntax is unique to Sway: when referring to a type directly, you preface the type with a tilde (~). To call an associated function, refer to the type and then the function name. To call a method, simply use dot syntax: foo.iz_baz_true().

