Storage access should be minimized, as it incurs a larger performance and gas cost than regular memory access. There are two types of storage access: reading and writing . Reading from Storage Reading from storage is less expensive than writing. To read a value from storage, use the .read() method: storage { owner: b256
} impure fn get_owner() -> ref b256 { storage.owner.read()
} This returns an immutable reference to a b256 which is held in storage. The read() method itself copies the value from storage and returns a pointer to it to save on actual storage read opcodes, which are expensive. This means that writing to a storage value will not update other variables that are holding references to that value acquired via read() . If you'd like an actual StorageRef to the value itself, which does not copy the value and instead incurs a storage read cost on every access, use .direct_read(). Writing to Storage Writing to storage is accomplished with the .write() method. The .write() method returns a special kind of mutable reference, called a MutStorageRef, which mutates storage directly upon every write. Writing to values of this type costs more gas than usual and should be minimized. contract; storage { owner: b256
